on(editor.getBody().firstChild, 0); // Optionally scroll to the top if the inserted template is larger than\n              // the editor viewport\n\n              editor.getWin().scrollTo(0, 0);\n            }\n          } else {\n            // In this demo we want to start an empty document with a title.\n            // This does not force having a title for a document, it\'s simply\n            // a convenience feature.\n            editor.setContent("<h1><br></h1>");\n          }\n        }\n      });\n      editor.on("preinit", function () {\n        // To prevent the placeholder to be submitted out of TinyMCE we\n        // remove it upon serialization. In this case, any <div> tag\n        // will be removed, so adapt it to your needs.\n        // https://www.tiny.cloud/docs/api/tinymce.dom/tinymce.dom.serializer/#addnodefilter\n        editor.serializer.addNodeFilter("div", function (nodes) {\n          nodes.forEach(function (node) {\n            node.remove();\n          });\n        });\n      });\n    },\n    // The following css will be injected into the editor, extending\n    // the default styles.\n    // In a real world scenario, with much more custom styles for headings\n    // links, tables, images etc, it\'s strongly recommended to use the\n    // content_css option to load a separate CSS file. Makes editing easier too.\n    // https://www.tiny.cloud/docs/configure/content-appearance/#content_style\n    // https://www.tiny.cloud/docs/configure/content-appearance/#content_css\n    content_style: `\n      body {\n        max-width: 720px;\n        margin: 2rem auto;\n      }\n\n      #placeholder {\n        color: #aaa;\n        display: flex;\n        flex-direction: column;\n        min-height: calc(100vh - 4rem);\n        -webkit-user-select: none;\n        /* Prevent any selections on the element */\n        user-select: none;\n      }\n\n      #placeholder * {\n        -webkit-user-select: none;\n        /* Prevent any selections on the element */\n        user-select: none;\n      }\n\n      #placeholder h1 {\n        margin: 0;\n      }\n\n      #placeholder button {\n        -webkit-appearance: none;\n        background: url(\'images/template-icon-document.png\') .25rem center no-repeat transparent;\n        background-size: 20px 20px;\n        border-radius: .25rem;\n        border: none;\n        color: #aaa;\n        cursor: default;\n        display: block;\n        font-family: inherit;\n        font-size: 1rem;\n        margin: .15rem -.25rem;\n        outline: none;\n        padding: .35rem .35rem .35rem calc(.5rem + 20px);\n        text-align: left;\n        transition: background-color .2s;\n        cursor: pointer;\n      }\n\n      #placeholder button:hover {\n        background-color: #f4f4f4;\n      }\n\n      #placeholder button.new-doc {\n        background-image: url(\'images/template-icon-new-document.png\');\n      }\n\n      #placeholder button.manage {\n        background-image: url(\'images/template-icon-manage.png\');\n      }\n    `\n  };\n})();'},402:function(e){"use strict";e.exports="<p>\x3c!--{title}--\x3e</p>\n<pre>\x3c!--{init}--\x3e</pre>\n<p><br /></p>"},638:function(e){"use strict";e.exports='<p>\x3c!--{title}--\x3e</p>\n<pre>\x3c!--{init}--\x3e</pre>\n<p><br />To test noeditable plugin use below:</p>\n<div class="myclass edit">This text should be editable</div>\n<div class="myclass noEdit">This text is NOT editable</div>\n<p><br /><br /><a name="pqr">abc</a> <br /><br /></p>\n<p>use below content to test convert_fonts_to_spans config</p>\n<p><span style="color: red; font-size: medium;">This is some text!</span> <span style="color: blue; font-size: small;">This is some text!</span> <span style="color: green; font-family: verdana;">This is some text!</span> <br /><br /></p>\n<p>use below content to test extended_valid_elements, custom_elements</p>\n<p><ele2>element 2</ele2></p>\n<ele1>element 1</ele1>\n<p><ele2>element 2</ele2> <br /><br /></p>\n<div id="container" style="border: 10px solid black;">fixed_toolbar_container test</div>\n<p><br /><br /></p>\n<h1>More content .....</h1>\n<h1>Paragraphs</h1>\n<h2>What this handout is about</h2>\n<p>This handout will help you understand how paragraphs are formed, how to develop stronger paragraphs, and how to completely and clearly express your ideas.</p>\n<h2>What is a paragraph?</h2>\n<p>Paragraphs are the building blocks of papers. Many students define paragraphs in terms of length: a paragraph is a group of at least five sentences, a paragraph is half a page long, etc. In reality, though, the unity and coherence of ideas among sentences is what constitutes a paragraph. A paragraph is defined as &ldquo;a group of sentences or a single sentence that forms a unit&rdquo; (Lunsford and Connors 116). Length and appearance do not determine whether a section in a paper is a paragraph. For instance, in some styles of writing, particularly journalistic styles, a paragraph can be just one sentence long. Ultimately, a paragraph is a sentence or group of sentences that support one main idea. In this handout, we will refer to this as the &ldquo;controlling idea,&rdquo; because it controls what happens in the rest of the paragraph.</p>\n<h2>How do I decide what to put in a paragraph?</h2>\n<p>Before you can begin to determine what the composition of a particular paragraph will be, you must first decide on an&nbsp;<a title="argument" href="https://writingcenter.unc.edu/tips-and-tools/argument/">argument</a>&nbsp;and a working&nbsp;<a title="Thesis Statements" href="https://writingcenter.unc.edu/tips-and-tools/thesis-statements/">thesis statement</a>&nbsp;for your paper. What is the most important idea that you are trying to convey to your reader? The information in each paragraph must be related to that idea. In other words, your paragraphs should remind your reader that there is a recurrent relationship between your thesis and the information in each paragraph. A working thesis functions like a seed from which your paper, and your ideas, will grow. The whole process is an organic one&mdash;a natural progression from a seed to a full-blown paper where there are direct, familial relationships between all of the ideas in the paper.</p>\n<p>The decision about what to put into your paragraphs begins with the germination of a seed of ideas; this &ldquo;germination process&rdquo; is better known as&nbsp;<a title="Brainstorming" href="https://writingcenter.unc.edu/tips-and-tools/brainstorming/">brainstorming</a>. There are many techniques for brainstorming; whichever one you choose, this stage of paragraph development cannot be skipped. Building paragraphs can be like building a skyscraper: there must be a well-planned foundation that supports what you are building. Any cracks, inconsistencies, or other corruptions of the foundation can cause your whole paper to crumble.</p>\n<p>So, let&rsquo;s suppose that you have done some brainstorming to develop your thesis. What else should you keep in mind as you begin to create paragraphs?&nbsp;<strong>Every paragraph in a paper should be</strong>:</p>\n<ul style="list-style-type: none;">\n<li><strong>Unified</strong>: All of the sentences in a single paragraph should be related to a single controlling idea (often expressed in the topic sentence of the paragraph).</li>\n<li><strong>Clearly related to the thesis</strong>: The sentences should all refer to the central idea, or thesis, of the paper (Rosen and Behrens 119).</li>\n<li><strong>Coherent</strong>: The sentences should be arranged in a logical manner and should follow a definite plan for development (Rosen and Behrens 119).</li>\n<li><strong>Well-developed</strong>: Every idea discussed in the paragraph should be adequately explained and supported through evidence and details that work together to explain the paragraph&rsquo;s controlling idea (Rosen and Behrens 119).</li>\n</ul>\n<h2>How do I organize a paragraph?</h2>\n<p>There are many different ways to organize a paragraph. The organization you choose will depend on the controlling idea of the paragraph.&nbsp;<strong>Below are a few possibilities for organization, with links to brief examples:</strong></p>\n<ul style="list-style-type: none;">\n<li><strong>Narration</strong>: Tell a story. Go chronologically, from start to finish. (<a title="Paragraph Development Examples" href="https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/">See an example.</a>)</li>\n<li><strong>Description</strong>: Provide specific details about what something looks, smells, tastes, sounds, or feels like. Organize spatially, in order of appearance, or by topic. (<a title="Paragraph Development Examples" href="https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/">See an example.</a>)</li>\n<li><strong>Process</strong>: Explain how something works, step by step. Perhaps follow a sequence&mdash;first, second, third. (<a title="Paragraph Development Examples" href="https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/">See an example.</a>)</li>\n<li><strong>Classification</strong>: Separate into groups or explain the various parts of a topic. (<a title="Paragraph Development Examples" href="https://writingcenter.unc.edu/tips-and-tools/paragraphs/paragraph-development-examples/">See an example.</a>)</li>\n<li><strong>Illustration</strong>: Give examples and explain how those examples prove your point. (See the detailed example in the next section of this handout.)</li>\n</ul>\n<h2>5-step process to paragraph development</h2>\n<p>Let&rsquo;s walk through a 5-step process for building a paragraph. For each step there is an explanation and example. Our example paragraph will be about slave spirituals, the original songs that African Americans created during slavery. The model paragraph uses illustration (giving examples) to prove its point.</p>\n<h3>Step 1. Decide on a controlling idea and create a topic sentence</h3>\n<p>Paragraph development begins with the formulation of the controlling idea. This idea directs the paragraph&rsquo;s development. Often, the controlling idea of a paragraph will appear in the form of a topic sentence. In some cases, you may need more than one sentence to express a paragraph&rsquo;s controlling idea.&nbsp;<strong>Here is the controlling idea for our &ldquo;model paragraph,&rdquo; expressed in a topic sentence:</strong></p>\n<p><strong>Model controlling idea and topic sentence</strong></p>\n<ul style="list-style-type: none;">\n<li style="list-style-type: none;">\n<ul style="list-style-type: none;">&nbsp;&mdash;&nbsp;Slave spirituals often had hidden double meanings.</ul>\n</li>\n</ul>\n<p>&nbsp;</p>\n<h3>Step 2. Explain the controlling idea</h3>\n<p>Paragraph development continues with an expression of the rationale or the explanation that the writer gives for how the reader should interpret the information presented in the idea statement or topic sentence of the paragraph. The writer explains his/her thinking about the main topic, idea, or focus of the paragraph.&nbsp;<strong>Here&rsquo;s the sentence that would follow the controlling idea about slave spirituals:</strong></p>\n<p><strong>Model explanation</strong></p>\n<ul style="list-style-type: none;">\n<li style="list-style-type: none;">\n<ul style="list-style-type: none;">&nbsp;&mdash;&nbsp;On one level, spirituals referenced heaven, Jesus, and the soul; but on another level, the songs spoke about slave resistance.</ul>\n</li>\n</ul>\n<p>&nbsp;</p>\n<h3>Step 3. Give an example (or multiple examples)</h3>\n<p>Paragraph development progresses with the expression of some type of support or evidence for the idea and the explanation that came before it. The example serves as a sign or representation of the relationship established in the idea and explanation portions of the paragraph.&nbsp;<strong>Here are two examples that we could use to illustrate the double meanings in slave spirituals:</strong></p>\n<p><strong>Model example A</strong></p>\n<ul style="list-style-type: none;">\n<li style="list-style-type: none;">\n<ul style="list-style-type: none;">&nbsp;&mdash; For example, according to Frederick Douglass, the song &ldquo;O Canaan, Sweet Canaan&rdquo; spoke of slaves&rsquo; longing for heaven, but it also expressed their desire to escape to the North. Careful listeners heard this second meaning in the following lyrics: &ldquo;I don&rsquo;t expect to stay / Much longer here. / Run to Jesus, shun the danger. / I don&rsquo;t expect to stay.&rdquo;</ul>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong>Model example B</strong></p>\n<ul style="list-style-type: none;">\n<li style="list-style-type: none;">\n<ul style="list-style-type: none;">&nbsp;&mdash;&nbsp;Slaves even used songs like &ldquo;Steal Away to Jesus (at midnight)&rdquo; to announce to other slaves the time and place of secret, forbidden meetings.</ul>\n</li>\n</ul>\n<p>&nbsp;</p>\n<h3>Step 4. Explain the example(s)</h3>\n<p>The next movement in paragraph development is an explanation of each example and its relevance to the topic sentence and rationale that were stated at the beginning of the paragraph. This explanation shows readers why you chose to use this/or these particular examples as evidence to support the major claim, or focus, in your paragraph.</p>\n<p>Continue the pattern of giving examples and explaining them until all points/examples that the writer deems necessary have been made and explained. NONE of your examples should be left unexplained. You might be able to explain the relationship between the example and the topic sentence in the same sentence which introduced the example. More often, however, you will need to explain that relationship in a separate sentence.&nbsp;<strong>Look at these explanations for the two examples in the slave spirituals paragraph:</strong></p>\n<p><strong>Model explanation for example A</strong></p>\n<ul style="list-style-type: none;">\n<li style="list-style-type: none;">\n<ul style="list-style-type: none;">&nbsp;&mdash; When slaves sang this song, they could have been speaking of their departure from this life and their arrival in heaven; however, they also could have been describing their plans to leave the South and run, not to Jesus, but to the North.</ul>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong>Model explanation for example B</strong></p>\n<ul style="list-style-type: none;">&nbsp;&mdash;&nbsp;[The relationship between example B and the main idea of the paragraph&rsquo;s controlling idea is clear enough without adding another sentence to explain it.]</ul>\n<h3>Step 5. Complete the paragraph&rsquo;s idea or transition into the next paragraph</h3>\n<p>The final movement in paragraph development involves tying up the loose ends of the paragraph and reminding the reader of the relevance of the information in this paragraph to the main or controlling idea of the paper. At this point, you can remind your reader about the relevance of the information that you just discussed in the paragraph. You might feel more comfortable, however, simply transitioning your reader to the next development in the next paragraph.&nbsp;<strong>Here&rsquo;s an example of a sentence that completes the slave spirituals paragraph:</strong></p>\n<p><strong>Model sentence for completing a paragraph</strong></p>\n<ul style="list-style-type: none;">\n<li style="list-style-type: none;">\n<ul style="list-style-type: none;">&nbsp;&mdash;&nbsp;What whites heard as merely spiritual songs, slaves discerned as detailed messages. The hidden meanings in spirituals allowed slaves to sing what they could not say.</ul>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong>Notice that the example and explanation steps of this 5-step process (steps 3 and 4) can be repeated as needed. The idea is that you continue to use this pattern until you have completely developed the main idea of the paragraph.</strong></p>\n<h3>Here is a look at the completed &ldquo;model&rdquo; paragraph:</h3>\n<ul style="list-style-type: none;">\n<li style="list-style-type: none;">\n<ul style="list-style-type: none;">Slave spirituals often had hidden double meanings. On one level, spirituals referenced heaven, Jesus, and the soul, but on another level, the songs spoke about slave resistance. For example, according to Frederick Douglass, the song &ldquo;O Canaan, Sweet Canaan&rdquo; spoke of slaves&rsquo; longing for heaven, but it also expressed their desire to escape to the North. Careful listeners heard this second meaning in the following lyrics: &ldquo;I don&rsquo;t expect to stay / Much longer here. / Run to Jesus, shun the danger. / I don&rsquo;t expect to stay.&rdquo; When slaves sang this song, they could have been speaking of their departure from this life and their arrival in heaven; however, they also could have been describing their plans to leave the South and run, not to Jesus, but to the North. Slaves even used songs like &ldquo;Steal Away to Jesus (at midnight)&rdquo; to announce to other slaves the time and place of secret, forbidden meetings. What whites heard as merely spiritual songs, slaves discerned as detailed messages. The hidden meanings in spirituals allowed slaves to sing what they could not say.</ul>\n</li>\n</ul>\n<p>&nbsp;</p>\n<h2>Troubleshooting paragraphs</h2>\n<h3>Problem: the paragraph has no topic sentence</h3>\n<p>Imagine each paragraph as a sandwich. The real content of the sandwich&mdash;the meat or other filling&mdash;is in the middle. It includes all the evidence you need to make the point. But it gets kind of messy to eat a sandwich without any bread. Your readers don&rsquo;t know what to do with all the evidence you&rsquo;ve given them. So, the top slice of bread (the first sentence of the paragraph) explains the topic (or controlling idea) of the paragraph. And, the bottom slice (the last sentence of the paragraph) tells the reader how the paragraph relates to the broader argument. In the original and revised paragraphs below, notice how a topic sentence expressing the controlling idea tells the reader the point of all the evidence.</p>\n<p><strong>Original paragraph</strong></p>\n<ul style="list-style-type: none;">\n<li style="list-style-type: none;">\n<ul style="list-style-type: none;">Piranhas rarely feed on large animals; they eat smaller fish and aquatic plants. When confronted with humans, piranhas&rsquo; first instinct is to flee, not attack. Their fear of humans makes sense. Far more piranhas are eaten by people than people are eaten by piranhas. If the fish are well-fed, they won&rsquo;t bite humans.</ul>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong>Revised paragraph</strong></p>\n<ul style="list-style-type: none;">Although most people consider piranhas to be quite dangerous, they are, for the most part, entirely harmless. Piranhas rarely feed on large animals; they eat smaller fish and aquatic plants. When confronted with humans, piranhas&rsquo; first instinct is to flee, not attack. Their fear of humans makes sense. Far more piranhas are eaten by people than people are eaten by piranhas. If the fish are well-fed, they won&rsquo;t bite humans.</ul>\n<p>&nbsp;</p>\n<p>Once you have mastered the use of topic sentences, you may decide that the topic sentence for a particular paragraph really shouldn&rsquo;t be the first sentence of the paragraph. This is fine&mdash;the topic sentence can actually go at the beginning, middle, or end of a paragraph; what&rsquo;s important is that it is in there somewhere so that readers know what the main idea of the paragraph is and how it relates back to the thesis of your paper. Suppose that we wanted to start the piranha paragraph with a transition sentence&mdash;something that reminds the reader of what happened in the previous paragraph&mdash;rather than with the topic sentence. Let&rsquo;s suppose that the previous paragraph was about all kinds of animals that people are afraid of, like sharks, snakes, and spiders. Our paragraph might look like this (the topic sentence is bold):</p>\n<ul style="list-style-type: none;">\n<li style="list-style-type: none;">\n<ul style="list-style-type: none;">Like sharks, snakes, and spiders, pirahnas are widely feared.&nbsp;</ul>\n</li>\n</ul>\n<p><strong>Although most people consider piranhas to be quite dangerous, they are, for the most part, entirely harmless</strong></p>\n<ul style="list-style-type: none;">. Piranhas rarely feed on large animals; they eat smaller fish and aquatic plants. When confronted with humans, piranhas&rsquo; first instinct is to flee, not attack. Their fear of humans makes sense. Far more piranhas are eaten by people than people are eaten by piranhas. If the fish are well-fed, they won&rsquo;t bite humans.</ul>\n<p>&nbsp;</p>\n<h3>Problem: the paragraph has more than one controlling idea</h3>\n<p>If a paragraph has more than one main idea, consider eliminating sentences that relate to the second idea, or split the paragraph into two or more paragraphs, each with only one main idea. Watch our&nbsp;<a href="https://writingcenter.unc.edu/tips-and-tools/reverse-outline/">short video on reverse outlining</a>&nbsp;to learn a quick way to test whether your paragraphs are unified. In the following paragraph, the final two sentences branch off into a different topic; so, the revised paragraph eliminates them and concludes with a sentence that reminds the reader of the paragraph&rsquo;s main idea.</p>\n<p><strong>Original paragraph</strong></p>\n<p>&nbsp;</p>\n<ul style="list-style-type: none;">\n<li style="list-style-type: none;">\n<ul style="list-style-type: none;">Although most people consider piranhas to be quite dangerous, they are, for the most part, entirely harmless. Piranhas rarely feed on large animals; they eat smaller fish and aquatic plants. When confronted with humans, piranhas&rsquo; first instinct is to flee, not attack. Their fear of humans makes sense. Far more piranhas are eaten by people than people are eaten by piranhas.&nbsp;</ul>\n</li>\n</ul>\n<p><del>A number of South American groups eat piranhas. They fry or grill the fish and then serve them with coconut milk or tucupi, a sauce made from fermented manioc juices.</del></p>\n<p>&nbsp;</p>\n<p><strong>Revised paragraph</strong></p>\n<p>&nbsp;</p>\n<ul style="list-style-type: none;">Although most people consider piranhas to be quite dangerous, they are, for the most part, entirely harmless. Piranhas rarely feed on large animals; they eat smaller fish and aquatic plants. When confronted with humans, piranhas&rsquo; first instinct is to flee, not attack. Their fear of humans makes sense. Far more piranhas are eaten by people than people are eaten by piranhas. If the fish are well-fed, they won&rsquo;t bite humans.</ul>\n<p>&nbsp;</p>\n<h1>Some more content .....</h1>\n<p><span style="text-decoration: underline;"><em><strong>Test page to test save/post content</strong></em></span></p>\n<table style="width: 50%;" border="1" width="100%">\n<tbody>\n<tr>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n</tr>\n<tr>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;\n<table style="width: 50%; border: 10; background-color: #f1c40f; border-color: #e03e2d; border-style: solid;" border="10" width="50%">\n<tbody>\n<tr>\n<td style="width: 33.3333%;">&nbsp;</td>\n<td style="width: 33.3333%;">&nbsp;</td>\n<td style="width: 33.3333%;">&nbsp;</td>\n</tr>\n<tr>\n<td style="width: 33.3333%;">&nbsp;</td>\n<td style="width: 33.3333%;">&nbsp;</td>\n<td style="width: 33.3333%;">&nbsp;</td>\n</tr>\n<tr>\n<td style="width: 33.3333%;">&nbsp;</td>\n<td style="width: 33.3333%;">&nbsp;</td>\n<td style="width: 33.3333%;">&nbsp;</td>\n</tr>\n</tbody>\n</table>\n</td>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n</tr>\n<tr>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n</tr>\n<tr>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n<td style="width: 20%;">&nbsp;</td>\n</tr>\n</tbody>\n</table>\n<p>Now you can quickly give TinyMCE 5 a new look and feel with our premium&nbsp;<a href="https://apps.tiny.cloud/products/skins-and-icon-packs/">Skins and Icon Packs</a>. We made skins for popular design systems such as Bootstrap, Microsoft Fabric and Google&rsquo;s Material Design, as well as a couple of alternate TinyMCE skins: a small skin to create an editor that is smaller overall, and a borderless skin, which is useful if you want to use TinyMCE in full screen or wrap the editor with your own borders.</p>\n<p>We also made different icon packs: one with the Material icons, one with smaller versions of our default icons, and one with fun and small icons from the&nbsp;<a href="https://jam-icons.com/">Jam icon</a>&nbsp;library.</p>\n<p>Here&rsquo;s a Closer Look at Each of the New Skins and Icon Packs.</p>\n<h4>Material</h4>\n<p>We have two Material skins, one with the classic Material look, and one with the newer Outline design.</p>\n<figure><img style="height: auto;" src="https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-classic@2x-1024x257.png" sizes="(max-width: 1024px) 100vw, 1024px" srcset="https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-classic@2x-1024x257.png 1024w, https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-classic@2x-300x75.png 300w, https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-classic@2x-768x192.png 768w, https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-classic@2x-600x150.png 600w, https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-classic@2x.png 1596w" alt="" />\n<figcaption>Material Classic skin for TinyMCE 5</figcaption>\n</figure>\n<figure><img style="height: auto;" src="https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-outline@2x-1024x257.png" sizes="(max-width: 1024px) 100vw, 1024px" srcset="https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-outline@2x-1024x257.png 1024w, https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-outline@2x-300x75.png 300w, https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-outline@2x-768x192.png 768w, https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-outline@2x-600x150.png 600w, https://go.tiny.cloud/wp-content/uploads/2017/05/skin-material-outline@2x.png 1596w" alt="" />\n<figcaption>Material Outline skin for TinyMCE 5</figcaption>\n</figure>\n<figure></figure>\n<ul style="list-style-type: square;">\n<li>You can also mix-and-match the skins and icon packs, and we&rsquo;ve put together a&nbsp;<a href="https://www.tiny.cloud/docs/enterprise/premium-skins-and-icon-packs/#iconpackcompatibilitymatrix">compatibility matrix</a>&nbsp;to help guide your decision making.</li>\n<li>If you missed our recent post announcing the new skins, it&rsquo;s a great place to start if you&rsquo;d like to understand our&nbsp;<a href="https://go.tiny.cloud/blog/a-new-approach-to-skinning-tinymce-5/">new approach to skinning TinyMCE 5</a>.</li>\n<li>We plan to release new skins and icon packs on an ongoing basis. These skins are built using our&nbsp;<a href="https://go.tiny.cloud/blog/a-new-approach-to-skinning-tinymce-5/">Style API</a>&nbsp;that we introduced with TinyMCE 5. The Style API allows for advanced skinning without any change to the CSS or HTML.</li>\n<li>If there are any skins or icon packs you would like us to consider for future releases, please drop us a line at team [at] tiny [dot] cloud and let us know.</li>\n<li>And to be kept up to date on future updates to our Skins and Icon Packs feature, and all important Tiny announcements, please follow us on&nbsp;<a href="https://www.twitter.com/joinTiny/">Twitter</a>&nbsp;and&nbsp;<a href="https://github.com/tinymce/tinymce">Github</a>, and you can sign up for our newsletter below.</li>\n</ul>\n<div style="left: 0px; width: 100%; height: 0px; position: relative; padding-bottom: 56.25%; max-width: 800px;" data-ephox-embed-iri="https://youtu.be/jqFMWNk8HR4"><iframe style="border: 0; top: 0; left: 0; width: 100%; height: 100%; position: absolute;" src="https://www.youtube.com/embed/jqFMWNk8HR4?rel=0" scrolling="no" allowfullscreen="allowfullscreen"></iframe></div>\n<p>&nbsp;</p>\n<div style="max-width: 800px;" data-ephox-embed-iri="https://google.com/google.jpg"><img src="https://www.google.com/logos/google.jpg" /></div>\n<p><a href="https://google.com">click here to go to google</a></p>\n<p>&nbsp;</p>\n<p><br /><br /></p>\n<h1>Heading level 1a</h1>\n<h2>Heading level 2a</h2>\n<h2>Heading level 2b</h2>\n<h3>Heading level 3b</h3>\n<h3>Heading level 3a</h3>\n<h4>Heading level 4a</h4>\n<h5>Heading level 5a</h5>\n<h6>Heading level 6a</h6>\n<h1>Heading level 1b</h1>\n<h2>Heading level 2b</h2>\n<h3>Heading level 3b</h3>\n<h4>Heading level 4b</h4>\n<h5>Heading level 5b</h5>\n<h6>Heading level 6b</h6>\n<h1>Heading level 1c</h1>\n<h2>Heading level 2c</h2>\n<h3>Heading level 3c</h3>\n<h4>Heading level 4c</h4>\n<h5>Heading level 5c</h5>\n<h6>Heading level 6c</h6>\n<h1>Heading level 1b</h1>\n<h2>Heading level 2b</h2>\n<h3>Heading level 3b</h3>\n<h4>Heading level 4b</h4>\n<h5>Heading level 5b</h5>\n<h6>Heading level 6b</h6>\n<h1>Heading level 1d</h1>\n<h2>Heading level 2d</h2>\n<h2>Heading level 2b</h2>\n<h3>Heading level 3b</h3>\n<h3>Heading level 3d</h3>\n<h4>Heading level 4d</h4>\n<h5>Heading level 5d</h5>\n<p><br /><br /></p>\n<p>Media urls QA</p>\n<p><br /><br />https://youtu.be/jqFMWNk8HR4 http://www.imdb.com/title/tt0116705/?ref_=fn_al_tt_1 https://www.instagram.com/p/BNXdWkBgDNG/ http://9gag.com/gag/avr1pRd http://giphy.com/gifs/monkey-7C06IEsrGj4SQ https://itunes.apple.com/au/album